        "twitter": "HEYOO!You\u00e2\u20ac\u2122ve reached the page of Amit Phaujdar :) I\u00e2\u20ac\u2122ve been a content writer/manager/marketer for B2B SaaS technology brands for the last three years, and I specialize in long-form content (blogs).If you want someone to write a blog post:- that\u00e2\u20ac\u2122s unaided by AI- that has a healthy dash of humor- that doesn\u00e2\u20ac\u2122t bore them to deathI\u00e2\u20ac\u2122m your guy.Not looking for a content writer? No problemo.Sick of following people who look, sound, and feel the same on LinkedIn?Sick of being drowned in mediocre content, courtesy of your friendly, neighborhood GPT?Well, you won\u00e2\u20ac\u2122t get that on this page. On LinkedIn, I share stories, research, anecdotes, and lessons on creativity that\u00e2\u20ac\u2122ll help you bash the 800-pound gorilla in the room aka creative block.Why creativity you ask?AI might have a million advantages, but there\u00e2\u20ac\u2122s one disadvantage that\u00e2\u20ac\u2122s largely overlooked.The more we outsource our creative thinking to AI, the more our creative muscles atrophy.Which is a pretty nice way to get stuck in an echo chamber of ideas. Kinda like the one we are in right now.Creativity is my way of breaking out of it. It\u00e2\u20ac\u2122s also my way of inspiring people to write about the topics they really care about, instead of trendjacking.Trendjacking isn\u00e2\u20ac\u2122t cool.You know what\u00e2\u20ac\u2122s cool?Evergreen content.Soo, if you:- want some help to create evergreen content for your brand while keeping your story at the center of it.- care more about striking a chord with your audience than just pleasing the algorithm.I\u00e2\u20ac\u2122m your guy. Hit me up in the DMs :)Or, if you just want to stay and enjoy the posts, that\u00e2\u20ac\u2122s cool too.*Leave a message at the sound of the tiny truck backing up*BEEEEEEEEEEEP!",
