        "company_specialties": "Machine Learning Graduate Research Assistant (PhD) Stanford University [2022-01-01] As a PhD student, I am working on projects related to machine learning (ML), natural language processing (NLP), computer vision (CV), psychology, and cognitive science (cogsci).Advisors: Dr. Michael C. Frank, Noah GoodmanOther: Leonidas Guibas, Douwe Kiela\u00e2\u2014\u00a6 BabyLM + VLM: Investigating why babies can learn language (and vision) and reason with much less data than LLMs and VLMs. Closing the performance gap while reducing orders of magnitude of training data and model size, e.g. using multimodal grounding, curricularization, and external guidance. Also investigating the best training data sources/format and evaluation benchmarks, including cognitive and psychologically inspired ones. Will allow for greatly improved efficiency, open-source availability, alignment, and interpretability of foundation models.\u00e2\u2014\u00a6 Diffusion Models & Text-to-Image Generation: Working on projects to enhance the efficiency and controllability of text-to-image generation.",
